<html lang="en"><head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Product Label</title>
    <style>
        body {
            display: flex;
            justify-content: center;
            align-items: center;
            width: 1000px;
            height: 1000px;
            margin: 0;
        }

        .label {
            width: 100%;
            height: 100%;
            border: 2px solid #000;
            padding: 20px;
            text-align: center;
            position: relative;
            box-sizing: border-box;
        }

        .label h1 {
            font-size: 20px;
            margin: 0;
        }

        .label p {
            margin: 10px 0;
        }

        .barcode {
            margin-top: 20px;
            font-size: 24px;
        }

        .logo-container {
            width: 100%;
            height: auto;
            max-height: 100px;
            object-fit: contain;
        }

        .price {
            position: absolute;
            bottom: 20px;
            left: 50%;
            transform: translateX(-50%);
            font-size: 24px;
            font-weight: bold;
        }
    </style>
